function showObj(id) {

    const width = $('.card').width();
    const height = 225;

    const renderer = new THREE.WebGLRenderer({
        canvas: document.querySelector('#canvas' + id)
    });
    renderer.setPixelRatio(window.devicePixelRatio);
    renderer.setSize(width, height);

    const scene = new THREE.Scene();
    const camera = new THREE.PerspectiveCamera(45, width / height);
    camera.position.set(0, 0, +4);

    const ambientLight = new THREE.AmbientLight(0xffffff, 0.4);
    scene.add(ambientLight);
    const directionalLight = new THREE.DirectionalLight(0xffffff);
    directionalLight.position.set(-1, 1, 1).normalize();
    scene.add(directionalLight);

    const manager = new THREE.LoadingManager();
    // const material = new THREE.MeshNormalMaterial();
    const mtlLoader = new THREE.MTLLoader(manager);
    mtlLoader.setResourcePath("./");
    mtlLoader.load(
        getSphere32times16HappyMtl(),
        // success
        function (material) {
            loadObject(material);
        },
        function (xhr) { console.log( ( xhr.loaded / xhr.total * 100 ) + '% loaded' ); },
        function (error) { console.log( 'An error happened' ); }
    );

    // 毎フレーム時に実行されるループイベント
    function tick(object) {
        object.rotation.y += 0.01;
        renderer.render(scene, camera);
        requestAnimationFrame(tick.bind(null, object));
    }

    function loadObject(material) {
        console.log("00000");
        const objLoader = new THREE.OBJLoader(manager);
        console.log("11111");
        objLoader.setMaterials(material);
        console.log(objLoader.material);
        objLoader.load(
            getSphere32times16Obj(),
            // success
            function (object) {
                console.log("33333");
                object.castShadow = true;
                object.position.x = 0;
                object.position.y = 0;
                object.position.z = 0;
                
                // object.traverse(function (child) {
                //     if (child instanceof THREE.Mesh) {
                //         child.material =  new THREE.MeshNormalMaterial();
                //     }
                // });

                scene.add(object);
                console.log("44444");
                tick(object);
                $('#svg-placeholder' + id).remove();
            },
            function (xhr) { console.log( ( xhr.loaded / xhr.total * 100 ) + '% loaded' ); },
            function (error) { console.log( 'An error happened' ); }
        );
    }
}

